import React from 'react';

// App Components
import Header from './components/Header';

// Bootstrap Components
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

const App = () => {
  return(
    <React.Fragment>
      <Header />
      <Container>
        <Row>
          <Col>Column</Col>
        </Row>
      </Container>
    </React.Fragment>
  );
}

export default App;
